vec2 tileToLatLong(vec2 tilexy, float zoom) {
    float n = pow(2.0, zoom);
    float lon_deg = tilexy.x / n * 360.0 - 180.0;
    float lat_rad = atan(sinh(M_PI * (1.0 - 2.0 * tilexy.y / n)));
    float lat_deg = lat_rad * 180.0 / M_PI;
    vec2 vec = vec2(lat_deg*M_PI/180.0, lon_deg*M_PI/180.0);
    return vec;
}

bool alain(vec2 tile, float zoom, vec2 uv, out vec2 uvout) {
    float n = pow(2.0, zoom);
    vec2 latlongmin = tileToLatLong(vec2(tile.x, n-tile.y), zoom);
    vec2 latlongmax = tileToLatLong(vec2(tile.x+1.0, n-tile.y-1.0), zoom);

    float xmin = (latlongmin.y+M_PI)/(M_PI*2.0);
    float xmax = (latlongmax.y+M_PI)/(M_PI*2.0);
    float ymin = (latlongmin.x+M_PI/2.0)/(M_PI);
    float ymax = (latlongmax.x+M_PI/2.0)/(M_PI);
